import React, {useEffect} from 'react';

function Card(props) {
  const { item } = props;
  if (!item) return null;

  return (
    <div
      className="border-gray-300 border flex-col shadow-md rounded-md  justify-items-center bg-white m-5 "
      style = {{width: "300px", height: "500px"}}
    >
      <img className="" src="images/boots.png" alt=""/>

      <p className="text-xl mt-2 ml-6 font-sans">{item.name}</p>
      <p className="mt-4 ml-6 text-base font-sans">{`${item.description}`}</p>
      <div className="flex ml-6 font-sans">
      <p className="mt-2 text-3xl">{`${item.price}`}</p><p className="mt-2 text-xl">{` руб.`}</p>
      <button type="button ml-3" >
          <img className="" src="images/basket.jpg" alt="" style = {{width: "50px", height: "40px"}}/>
        </button>
      </div>

    </div>
  );
}

export default Card;
